import React from 'react';
import Jumbotron from './components/Jumbotron';
import imageThumbnail from './components/image-thumbnail';

const imgCast =["../public/images/arya.jpeg"]


function App() {
  return (
<div>
  <Jumbotron />
  <div className="container">
    <div className="row">
      <div className="col">
      <imageThumbnail
      source={imgCast[0]}
      />

      </div>
    </div>
  </div>
</div>
  );
}

export default App;
